// Get the exact byte code from the remix solidity byte code ful object
const FarmlandCrowdsaleDeployerByteCode = FarmlandCrowdsaleDeployerByteCodeFull["object"]

// Detect when the page is loaded
window.addEventListener('load', (event) => {
    console.log('The page has fully loaded');
});

// On load enable all the fields
window.onload = (event) => {
    console.log('The page has fully loaded - onload');
	document.getElementById("parcelOwner").removeAttribute("disabled");
	document.getElementById("parcelDetails").removeAttribute("disabled");
	document.getElementById("totalAcres").removeAttribute("disabled");
	document.getElementById("name").removeAttribute("disabled");
	document.getElementById("symbol").removeAttribute("disabled");
	document.getElementById("initialSupply").removeAttribute("disabled");
	document.getElementById("goal").removeAttribute("disabled");
	document.getElementById("rateIncrementer").removeAttribute("disabled");
};

//dApp frontend logic

// get the current account - wallet address from metamask and set the wallet address field
async function get_current_account() {
    var account = await window.web3.eth.getAccounts();
    var userAccount = account[0];

    document.getElementById("walletAddress").setAttribute("value", userAccount);
    window.web3.eth.defaultAccount = userAccount;
    return userAccount;
}

// Process the get wallet button - connect to metamask
async function get_wallet() {

	console.log("Get Wallet");
    const walletAddress = await window.ethereum.request({
        method: "eth_requestAccounts",
        params: [
          {
            eth_accounts: {}
          }
        ]
      });
      
    await window.ethereum.request({
        method: "wallet_requestPermissions",
        params: [
            {
              eth_accounts: {}
            }
        ]
    });
    
    document.getElementById("walletAddress").removeAttribute("disabled");
    
    get_current_account();
}

// Process the start crowdsale button - deploy the contract and update the contract address field
async function start_crowdsale() {

	console.log("Start Crowdsale");
	console.log(document.getElementById('name').value);
	console.log(document.getElementById('symbol').value);
	console.log(document.getElementById('initialSupply').value);
	console.log(document.getElementById('walletAddress').value);
	console.log(document.getElementById('goal').value);
	console.log(document.getElementById('rateIncrementer').value);

	var parcelOwner = document.getElementById('parcelOwner').value;
	var parcelDetails = document.getElementById('parcelDetails').value;
	var totalAcres = document.getElementById('totalAcres').value;
	var name = document.getElementById('name').value;
	var symbol = document.getElementById('symbol').value;
	var initialSupply = document.getElementById('initialSupply').value
	var crowdsale_wallet_address = document.getElementById('walletAddress').value;
	var goal = document.getElementById('goal').value;
	var rateIncrementer = document.getElementById('rateIncrementer').value;

	var contract = new window.web3.eth.Contract(FarmlandCrowdsaleDeployerAbi);
	var byteCode = FarmlandCrowdsaleDeployerByteCode;
	var contractAddress = 0;

	deployed_contract = await contract.deploy({
		data: byteCode,
		arguments: [parcelOwner, parcelDetails, totalAcres, name, symbol, initialSupply, crowdsale_wallet_address, goal, rateIncrementer],
	}).send({
			from: crowdsale_wallet_address,
			gas: 4000000
	})
	.on('error', (error) => {
		console.log("Error: ", error);
	}).on('transactionHash', (transactionHash) => {
		console.log("TxHash: ", transactionHash);
	}).on('receipt', (receipt) => {
	  console.log("Address: ", receipt.contractAddress);
	  contractAddress = receipt.contractAddress;
	}).then((newContractInstance) => {
		console.log(newContractInstance);   
	}).catch(function(error) {
		console.log(error);
	});

	console.log(contractAddress);
	const FarmlandCrowdsaleDeployer = new window.web3.eth.Contract(FarmlandCrowdsaleDeployerAbi, contractAddress);

	var FarmlandCrowdsaleAddress = await FarmlandCrowdsaleDeployer.methods.farmland_crowdsale_address().call();
	var FarmlandTokenAddress = await FarmlandCrowdsaleDeployer.methods.farmland_token_address().call();

	console.log(FarmlandCrowdsaleAddress);
	console.log(FarmlandTokenAddress);

	document.getElementById("tokenAddress").removeAttribute("disabled");
    document.getElementById("tokenAddress").setAttribute("value", "Token Address : " + FarmlandTokenAddress);

	document.getElementById("crowdsaleAddress").removeAttribute("disabled");
    document.getElementById("crowdsaleAddress").setAttribute("value", "Crowdsale Address : " + FarmlandCrowdsaleAddress);

	document.getElementById("deployerAddress").removeAttribute("disabled");
    document.getElementById("deployerAddress").setAttribute("value", "Deployer Address : " + contractAddress);

	localStorage.setItem('farmlandTokenAddress', FarmlandTokenAddress);
	localStorage.setItem('farmlandCrowdsaleAddress', FarmlandCrowdsaleAddress);
}